async function foo() {
   return fetch('http://127.0.0.1:5555/moves')
       .then(r => r.json())
       .then(r => {return r});
   // console.log(result)
}

async function caller() {
   const json = await foo();
   console.log(json)
}

// let response = wtf();

caller()

console.log('yoyo')
